import React from 'react';
import { Row, Col } from 'react-bootstrap';
import Product from '../components/Product'; // Lisa see import
import products from '../products'; // Lisa see import

const HomeScreen = () => {
    return (
        <>
            <div className="container text-center">
                <Row className="justify-content-center">
                    <Col md={12}>
                        <img src="" alt="Tere tulemast" style={{ width: '100%', maxWidth: '400px', height: 'auto' }} />
                        <h1 style={{ color: '#ffffff', fontSize: '48px', marginTop: '20px' }}>Tere tulemast</h1>
                    </Col>
                </Row>
            </div>

            <Row>
                {products.map((product) => (
                    <Col key={product._id} sm={12} md={4} lg={4} xl={4}>
                        <Product product={product} />
                    </Col>
                ))}
            </Row>
        </>
    );
};

export default HomeScreen;
